"33375" : {
"id":33375,
"typeIconPath":"data/icons/ArchiMate/BusinessRole.png",
"data" : [
{
"lang":"nl",
"name":"Zorginstituut Nederland",
"type":"Bedrijfsrol",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 9pt;\">Zorginstituut Nederland is een zelfstandige overheidsorganisatie, die de uitvoering en financiering van de Zorgverzekeringswet (Zvw) en Wet langdurige zorg (Wlz) coordineert. Taken van het Zorginstituut zijn onder andere risicoverevening, zorg voor bijzondere groepen en pakketbeheer. &nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">In opdracht van het Ministerie van Volksgezondheid, Welzijn en Sport (VWS) is het Zorginstituut verantwoordelijk voor het beheer van de iStandaarden, waaronder iWlz, iJw en iWmo. Ook let het Zorginstituut erop dat de uitvoering van de Wlz doelmatig verloopt. Tenslotte stelt het Zorginstituut elk kwartaal de landelijke rapportage samen, die onder andere laat zien hoe de wachtlijsten in de Wlz zich ontwikkelen.&nbsp;<p style=\"margin-top: 3pt;\"> &nbsp;<p style=\"margin-top: 3pt;\"> &nbsp;<p style=\"margin-top: 3pt;\"></span>"}}]
}
]
}
