"28147" : {
"id":28147,
"typeIconPath":"data/icons/ArchiMate/MotivationUseCase.png",
"data" : [
{
"lang":"nl",
"name":"IV007: Hoe wordt de naam van een client of relatie vastgelegd?`",
"type":"Usecase",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">Van een client of relatie worden de achternaam, voorvoegsel en voornamen en/of voorletters gescheiden vastgelegd. Voor het vastleggen van de VolledigeNaam van een client geldt het volgende format: &nbsp;<p style=\"margin-top: 3pt;\">* De Geslachtsnaam wordt altijd vastgelegd. Deze bestaat uit de Naam en eventueel een Voorvoegsel; &nbsp;<p style=\"margin-top: 3pt;\">* De Partnernaam kan worden vastgelegd. Ook deze bestaat uit de Naam en eventueel een Voorvoegsel; &nbsp;<p style=\"margin-top: 3pt;\">* Voornamen kunnen worden vastgelegd, gescheiden door spaties; &nbsp;<p style=\"margin-top: 3pt;\">* Voorletters kunnen worden vastgelegd, aaneengesloten, zonder punten of spaties; &nbsp;<p style=\"margin-top: 3pt;\">* NaamGebruik geeft de gewenste aanspreekvorm aan. Hiermee wordt bij correspondentie de volgorde bepaald in het gebruik van de geslachtsnaam en de naam van de partner. Het vullen van NaamGebruik hangt dus af van hoe de client of relatie zijn/haar naam hanteert.&nbsp;<p style=\"margin-top: 3pt;\"></span>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"IO31","id":29310,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"ZK31","id":29659,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"AW33","id":30150,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"ZK33","id":30568,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Invulinstructie":{"code":"IV007"}}}]
}
]
}
,
"28186" : {
"id":28186,
"typeIconPath":"data/icons/ArchiMate/MotivationUseCase.png",
"data" : [
{
"lang":"nl",
"name":"IV025: Hoe gebruik ik de diagnosecodelijsten om ziektebeeld en stoornisgegevens vast te leggen?",
"type":"Usecase",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">Het CIZ maakt bij het vastleggen van ziektebeeld- en stoornisgegevens gebruik van diagnosecodelijsten die zijn gebaseerd op de ICD10, de DSM IV, de ICF, de IQ en de lijsten 'Visueel' en 'Auditief'. Bij de ziektebeeld- en stoornisgegevens legt het CIZ in drie stappen informatie vast over het ziektebeeld van de client. Met de waarde (code) in Diagnosecodelijst geeft het CIZ aan welke van bovengenoemde classificaties wordt gebruikt. Deze code bepaalt vervolgens welke informatie in SubcodeDiagnosecodelijst en ZiektebeeldStoornis vastgelegd mag worden. &nbsp;<p style=\"margin-top: 3pt;\">Let op! De unieke aanduiding van ZiektebeeldStoornis is COD529. Voor dit gegeven bestaat geen &#233;&#233;n-op-&#233;&#233;n relatie met een codelijst; er is g&#233;&#233;n codelijst met de aanduiding COD529. De codelijst die het CIZ gebruikt om ZiektebeeldStoornis te vullen, hangt af van de vulling van de voorgaande rubrieken.&nbsp;<p style=\"margin-top: 3pt;\"></span>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"IO31","id":29310,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"ZK31","id":29659,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"AW33","id":30150,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"ZK33","id":30568,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"AW317","id":30562,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Invulinstructie":{"code":"IV025"}}}]
}
]
}
,
