"data" : [
{
"lang":"nl",
"name":"IV027: Hoe moet in geval van additionele zorg de opslag gevuld worden?",
"type":"Usecase",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">Indien er sprake is van additionele zorg (extra zorg bovenop de hoogste klasse van een functie), moet bij Opslag het aantal extra te leveren of geleverde zorgeenheden ingevuld worden.&nbsp;<p style=\"margin-top: 3pt;\"></span>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"IO31","id":29310,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"ZK31","id":29659,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"AW33","id":30150,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"AW35","id":30565,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"ZK33","id":30568,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"ZK35","id":30585,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Invulinstructie":{"code":"IV027"}}}]
}
]
