"lang":"nl",
"name":"TR021: Voor iedere client geldt dat er minimaal n toegewezen zorgeenheid moet zijn waarbij Instelling hoort bij Ontvanger.",
"type":"Beperking",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">* Regionaal (AW33) geldt dat de Instelling uit de toewijzing gelijk is aan de Ontvanger.&nbsp;<p style=\"margin-top: 3pt;\">* Bovenregionaal (ZK33) geldt dat de Instelling conform de iWlz-AGB-codelijst hoort bij de Ontvanger.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\"><i>Let op: de toegewezen zorg is niet direct aan de Client gekoppeld.</span><span style=\" font-size: 10pt;\"></i></span><span style=\" font-size: 10pt; font-family: Arial;\">&nbsp;<p style=\"margin-top: 3pt;\"></span>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"AW33","id":30150,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"LDT_RetourCode-Wlz","id":30317,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"ZK33","id":30568,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Technische regel":{"code":"TR021","niveau":"standaard"}}}]
