"type":"Beperking",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">Als Afgiftedatum in de Indicatie groter is dan 1 maart 2007 en Leefeenheid in de Client de waarde 3 of 4 (beide: heeft huishouden met partner) heeft, dan moet er een Relatie zijn waarin Soort de waarde 12 (partner) bevat. &nbsp;<p style=\"margin-top: 3pt;\">&quot;Let op: de waarde van BurgerlijkeStaat in de Client doet niet ter zake.&quot;</span><span style=\" font-size: 10pt; font-family: Times New Roman;\"></span><span style=\" font-family: Times New Roman;\">&nbsp;<p style=\"margin-top: 3pt;\"></span><span style=\" font-family: Arial;\"></span><span style=\" font-size: 10pt; font-family: Arial;\">&nbsp;<p style=\"margin-top: 3pt;\"></span>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"IO31","id":29310,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"ZK31","id":29659,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"AW33","id":30150,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"LDT_RetourCode-Wlz","id":30317,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"ZK33","id":30568,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Technische regel":{"code":"TR004","niveau":"standaard"}}}]
