"28030" : {
"id":28030,
"typeIconPath":"data/icons/ArchiMate/MotivationUseCase.png",
"data" : [
{
"lang":"nl",
"name":"IV028: Hoe wordt een retourbestand opgesteld?",
"type":"Usecase",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">Een retourbestand wordt gestuurd om de zender te informeren over de beoordeling (technisch/inhoudelijk) van het heenbericht. &nbsp;<p style=\"margin-top: 3pt;\">Een retourbestand wordt als volgt opgebouwd: &nbsp;<p style=\"margin-top: 3pt;\">Een retourbestand bevat een Header en indien van toepassing alle berichtklassen die horen bij de Client of Clienten die afgekeurd worden.&nbsp;<p style=\"margin-top: 3pt;\"><u>Header:</u> &nbsp;<p style=\"margin-top: 3pt;\"><ul style=\"margin-top: 0pt; margin-bottom: 0pt;\"><li>In de header wordt de BerichtCode gevuld met de berichtcode van het betreffende retourbericht. </li><li>Overige elementen, inclusief Afzender en Ontvanger, worden ongewijzigd overgenomen van de header van het heenbericht. </li><li>De header wordt aangevuld met identificerende gegevens van het retourbericht (IdentificatieRetour en DagtekeningRetour) en kan worden aangevuld met het versienummer van de XSLT's die gebruikt zijn om het bericht te controleren.</ul><u>Overige berichtklassen:&nbsp;<p style=\"margin-top: 3pt;\"></li><ul style=\"margin-top: 0pt; margin-bottom: 0pt;\"></u><li>Indien in &#233;&#233;n van de berichtklassen over een Client fouten zijn geconstateerd, worden alle berichtklassen van die Client ongewijzigd overgenomen in het retourbestand.</li><li>Clienten waarin geen fouten zijn geconstateerd, worden niet opgenomen in het retourbestand.</ul><u>Retourcodes:&nbsp;<p style=\"margin-top: 3pt;\"></li><ul style=\"margin-top: 0pt; margin-bottom: 0pt;\"></u><li>Indien fouten zijn geconstateerd, worden bij iedere berichtklasse in een retourbestand een (1) of meer retourcodes opgenomen die voor de betreffende berichtklasse aangeven wat er fout is, ofwel dat de betreffende klasse niet beoordeeld is (code 0233) of dat de betreffende klasse geen fouten bevat (code 0200).</ul><b>&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Goedgekeurd bericht&nbsp;<p style=\"margin-top: 3pt;\"></b>Wanneer het heenbericht volledig is goedgekeurd bevat het retourbericht alleen een Header, zonder retourcodes.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\"></li>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"WLZ Retour","id":28796,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Invulinstructie":{"code":"IV028"}}}]
}
]
}
