"28083" : {
"id":28083,
"typeIconPath":"data/icons/ArchiMate/MotivationRequirement.png",
"data" : [
{
"lang":"nl",
"name":"OP021: Een nieuw indicatiebesluit leidt ertoe dat de geldigheid van het vorige indicatiebesluit eindigt op de dag voorafgaand aan de ingangsdatum van het nieuwe besluit.",
"type":"Requirement",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">Nog lopende toewijzingen moeten door het zorgkantoor worden beeindigd op de laatste datum van geldigheid van het vorige besluit: &nbsp;<p style=\"margin-top: 3pt;\">* zorgaanbieders die betrokken blijven bij de zorglevering aan de client ontvangen geen intrekking van de zorgtoewijzing, maar ontvangen een nieuwe zorgtoewijzing op basis van het nieuwe besluit. &nbsp;<p style=\"margin-top: 3pt;\">* zorgaanbieders die niet meer betrokken zijn bij de zorglevering aan de client ontvangen een intrekking op basis van het vorige besluit.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Indien het nieuwe indicatiebesluit een negatief besluit is, dan wordt dit besluit afgegeven met een ingangsdatum die een (1) dag later is dan de afgiftedatum van het besluit. Een negatief besluit bevat geen geindiceerde zorgeenheden (leeg besluit). &nbsp;<p style=\"margin-top: 3pt;\">Zorgaanbieders die betrokken waren bij de zorglevering aan de client ontvangen een intrekking op basis van het vorige besluit.&nbsp;<p style=\"margin-top: 3pt;\"></span>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"IO31","id":29310,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Bedrijfsregel":{"code":"OP021","geen technische regels":false}}}]
}
]
}
