"28069" : {
"id":28069,
"typeIconPath":"data/icons/ArchiMate/MotivationUseCase.png",
"data" : [
{
"lang":"nl",
"name":"IV032: Welke retourcode moet gevuld worden in het retourbericht?",
"type":"Usecase",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">Welke retourcode gevuld moet worden, wordt bepaald door controle op basis waarvan het bericht wordt afgekeurd. De retourcode wordt meegegeven bij de berichtklasse waarop de controle van toepassing is.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Technische regels, condities en constraints die niet op basis van een XSD validatie gecontroleerd kunnen worden, hebben een eigen retourcode. Voor regels die op basis van de XSLT's gecontroleerd worden mag ook retourcode 0001 (Bericht is technisch onjuist) gebruikt worden. Regels die op basis van het XSD gecontroleerd worden, gebruiken ook retourcode 0001. Daarnaast zijn nog een aantal algemene retourcodes beschikbaar.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Een ontvangen bestand wordt op vier niveau's gecontroleerd. &nbsp;<p style=\"margin-top: 3pt;\"><b>Niveau 1:&nbsp;<p style=\"margin-top: 3pt;\"></b>Het bestand wordt gecontroleerd op leesbaarheid en gevalideerd tegen het XSD. &nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Indien het bestand niet leesbaar is of niet valideert, krijgt de afzender een foutmelding. Indien nodig neemt de ontvanger buiten het berichtenverkeer contact op met de verzender. Er wordt geen retourbericht verzonden.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\"><b>Niveau</b> <b>2:&nbsp;<p style=\"margin-top: 3pt;\"></b>Het bericht wordt gecontroleerd tegen alle regels (technische regels, condities en constraints) die binnen het bericht zelf te controleren zijn. Voor deze regels zijn XSLT's beschikbaar die gebruikt kunnen worden om de controles uit te voeren. &nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Wanneer fouten worden geconstateerd bevat het retourbestand:&nbsp;<p style=\"margin-top: 3pt;\"><ul style=\"margin-top: 0pt; margin-bottom: 0pt;\"><li>Ofwel: alleen de Header, met retourcode 0001 (Bericht is technisch onjuist) en het versienummer van de XSLT's die gebruikt zijn voor de controle.<b></b></li><li>Ofwel: de header en de berichtklassen van de Client of Clienten die afgekeu<span style=\" font-family: Arial;\">rd worden, voorzien van retourcode(s). </span><span style=\" font-family: Arial;\">De retourcode die hoort bij de regel op basis waarvan het bericht wordt afgekeurd, wordt ingevuld bij de berichtklasse waarin de fout is geconstateerd.</span><span style=\" font-family: Arial;\"><b></ul>&nbsp;<p style=\"margin-top: 3pt;\">Niveau 3:&nbsp;<p style=\"margin-top: 3pt;\"></b>Het bestand wordt gecontroleerd op alle overige regels die niet binnen het bestand zelf gecontroleerd kunnen worden. Dit betekent dat gecontroleerd wordt op:&nbsp;<p style=\"margin-top: 3pt;\"></li><ul style=\"margin-top: 0pt; margin-bottom: 0pt;\"><li>Systeemdatum om te bepalen of de dagtekening niet in de toekomst ligt;<b></b></li><li>Alle berichtoverstijgende technische regels;<b></b></li><li>Dynamische codelijsten die niet als enumeratie in de XSD's zijn opgenomen, zoals de iWlz-AGB-codelijst.<b></ul></b>&nbsp;<p style=\"margin-top: 3pt;\">Wanneer fouten zijn geconstateerd bevat het retourbestand de header en de berichtklassen van de Client of Clienten die afgekeurd worden, voorzien van retourcode(s)<span style=\" font-family: Arial;\">.</span><span style=\" font-family: Arial;\"> De retourcode die hoort bij de regel op basis waarvan het bericht wordt afgekeurd, wordt ingevuld bij de berichtklasse waarin de fout is geconstateerd.&nbsp;<p style=\"margin-top: 3pt;\"><b>Niveau 4:&nbsp;<p style=\"margin-top: 3pt;\"></b>Het bericht wordt gecontroleerd op aanvullende afspraken die niet gecontroleerd kunnen worden op basis van informatie die binnen de standaard wordt uitgewisseld. Voor deze controles zijn een beperkt aantal retourcodes beschikbaar, het gebruik hiervan is beperkt tot:&nbsp;<p style=\"margin-top: 3pt;\"></li><ul style=\"margin-top: 0pt; margin-bottom: 0pt;\"><li>Een Aanvang zorg CAK bericht of Mutatie zorg CAK bericht kan worden afgekeurd met retourcodes binnen de range 0328 t/m 1161.</ul>&nbsp;<p style=\"margin-top: 3pt;\"><b>Bijvoorbeeld:</b> Het Zorgkantoor ontvangt een verwijdering (status aanlevering 3) van een AW35 bericht waarin de aanvang zorg van een zorgzwaartepakket wordt gemeld, maar heeft de eerste aanlevering niet ontvangen. Het bericht wordt dan afgekeurd op basis van TR063.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">In het retourbericht worden de volgende retourcodes gevuld:&nbsp;<p style=\"margin-top: 3pt;\"></li><ul style=\"margin-top: 0pt; margin-bottom: 0pt;\"><li>Header: Retourcode 0200 (Geen opmerkingen over deze berichtklasse)</li><li>Client: Retourcode 0200 (Geen opmerkingen over deze berichtklasse)</li><li>GeleverdZorgzwaartepakket: Retourcode 9063 (Bericht voldoet niet aan technische regel 63).</ul><span style=\" font-family: Arial;\">&nbsp;<p style=\"margin-top: 3pt;\"></span></li>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"WLZ Retour","id":28796,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Invulinstructie":{"code":"IV032"}}}]
}
]
}
,
