"28110" : {
"id":28110,
"typeIconPath":"data/icons/ArchiMate/MotivationUseCase.png",
"data" : [
{
"lang":"nl",
"name":"IV013: Welke zorgtoewijzing is het meest recent?",
"type":"Usecase",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">Om vast te kunnen stellen welke zorgtoewijzing het recentst is, zijn Toewijzingsdatum en Toewijzingstijd in het zorgtoewijzingbericht opgenomen. Het zorgkantoor vult deze velden met de datum en de tijd waarop de zorgtoewijzing definitief is vastgesteld. Het gaat hier om het moment waarop het zorgkantoor de zorgtoewijzing vaststelt en niet om het moment van verzending van het bericht. De zorgtoewijzing met de meest recente Toewijzingsdatum en Toewijzingstijd is het actuele zorgtoewijzingbericht. &nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Als een zorgaanbieder het zorgkantoor verzoekt om een bestaande zorgtoewijzing nog een keer te versturen, blijft de inhoud van Toewijzingsdatum en Toewijzingstijd onveranderd. &nbsp;<p style=\"margin-top: 3pt;\">Een intrekking van de zorgtoewijzing moet beschouwd worden als een gewijzigde zorgtoewijzing. Het zorgkantoor vult Toewijzingsdatum en Toewijzingstijd met de datum en tijd waarop het zorgkantoor de intrekking vaststelt. &nbsp;<p style=\"margin-top: 3pt;\">In geval van een bovenregionale zorgtoewijzing neemt het bovenregionale zorgkantoor Toewijzingsdatum en Toewijzingstijd ongewijzigd over uit het ZK33-bericht.&nbsp;<p style=\"margin-top: 3pt;\"></span>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"ZK31","id":29659,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"AW33","id":30150,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"ZK33","id":30568,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Invulinstructie":{"code":"IV013"}}}]
}
]
}
