"28211" : {
"id":28211,
"typeIconPath":"data/icons/ArchiMate/MotivationRequirement.png",
"data" : [
{
"lang":"nl",
"name":"OP122: Het regionale zorgkantoor is verantwoordelijk voor de zorgtoewijzing van de client. Deze verantwoordelijkheid eindigt op het moment dat dossieroverdracht plaatsvindt naar een ander zorgkantoor.",
"type":"Requirement",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">Met ingang van de overdrachtdatum is het nieuwe zorgkantoor verantwoordelijk voor de client. In de praktijk heeft dit tot gevolg dat het bovenregionale zorgkantoor tot aan het moment van dossieroverdracht of tot aan het ontvangen van een nieuw indicatiebesluit (indien geen dossieroverdracht heeft plaatsgevonden) de berichten tussen de zorgaanbieder en het regionale zorgkantoor doorstuurt. &nbsp;<p style=\"margin-top: 3pt;\">Als door de afgifte van een nieuw indicatiebesluit een ander zorgkantoor verantwoordelijk wordt voor de zorgtoewijzing van de client, dan stelt het nieuwe zorgkantoor het oude zorgkantoor (bijvoorbeeld via het beveiligde notitieverkeer) van deze situatie op de hoogte. &nbsp;<p style=\"margin-top: 3pt;\"></span>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"ZK31","id":29659,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"AW33","id":30150,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"ZK33","id":30568,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Bedrijfsregel":{"code":"OP122","geen technische regels":false}}}]
}
]
}
,
"28196" : {
"id":28196,
"typeIconPath":"data/icons/ArchiMate/MotivationConstraint.png",
"data" : [
{
"lang":"nl",
"name":"TR046: De Leveringsstatus moet toegestaan zijn bij de opgegeven Mutatiecode.",
"type":"Beperking",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">De volgende waarden zijn in combinatie met Mutatiecode toegestaan:&nbsp;<p style=\"margin-top: 3pt;\"> &nbsp;<p style=\"margin-top: 3pt;\">* Mutatiecode 12 (client wil de zorg (nu) nog niet) -- 3 (Wacht uit voorzorg) of 5 (einde zorgvraag); &nbsp;<p style=\"margin-top: 3pt;\">* Mutatiecode 17 (overplaatsing (er is een MAZ)) -- 5 (einde zorgvraag); &nbsp;<p style=\"margin-top: 3pt;\">* Mutatiecode 18 (aanbieder kan de zorg nu nog niet leveren) -- 6 (urgent plaatsen), 7 (actief plaatsen) of 2 (wacht op voorkeur); &nbsp;<p style=\"margin-top: 3pt;\">* Mutatiecode 19 (levering zorg is beeindigd - zorgtoewijzing sluiten) -- 5 (einde zorgvraag); &nbsp;<p style=\"margin-top: 3pt;\">* Mutatiecode 20 (levering zorg is beeindigd - zorgtoewijzing aanhouden) -- 6 (urgent plaatsen), 7 (actief plaatsen), 2 (wacht op voorkeur) of 3 (wacht uit voorzorg)</span><span style=\" font-size: 10pt; font-family: Arial;\">;</span><span style=\" font-size: 10pt;\">&nbsp;<p style=\"margin-top: 3pt;\">* Mutatiecode 21 (overdracht ZTW (er is geen MAZ)) -- 5 (einde zorgvraag). &nbsp;<p style=\"margin-top: 3pt;\"></span>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"AW39","id":27986,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"LDT_RetourCode-Wlz","id":30317,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"ZK39","id":30559,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Technische regel":{"code":"TR046","niveau":"standaard"}}}]
}
]
}
,
"28206" : {
"id":28206,
"typeIconPath":"data/icons/ArchiMate/MotivationRequirement.png",
"data" : [
{
"lang":"nl",
"name":"OP137: Per client krijgt elk indicatiebesluit een uniek indicatiebesluitnummer.",
"type":"Requirement",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">Elk volgend indicatiebesluit krijgt een nieuw indicatiebesluitnummer als het voorgaande bericht foutloos geaccepteerd is door het zorgkantoor. Een indicatiebesluit krijgt geen nieuw besluitnummer als het zorgkantoor een fout heeft geconstateerd in het eerder ontvangen indicatiebesluitbericht dat gebaseerd is op die uitspraak. Het CIZ stuurt in dat geval het bericht opnieuw, gecorrigeerd, op.&nbsp;<p style=\"margin-top: 3pt;\"></span>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"IO31","id":29310,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"AW33","id":30150,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"ZK33","id":30568,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Bedrijfsregel":{"code":"OP137","geen technische regels":false}}}]
}
]
}
