"lang":"nl",
"name":"OP312: Na dossieroverdracht van een client stuurt het nieuwe zorgkantoor naar aanleiding van het/de ontvangen bericht(en) van de zorgaanbieder(s) een bericht naar het CAK.",
"type":"Requirement",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">Dit betreft een melding aanvang zorg door het nieuwe zorgkantoor, waardoor een zogenaamde MAZ op MAZ - situatie ontstaat bij het CAK. &nbsp;<p style=\"margin-top: 3pt;\"></span>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"requirementtype":"Onbepaald","wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"CA317","id":27946,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Bedrijfsregel":{"code":"OP312"}}}]
