"28191" : {
"id":28191,
"typeIconPath":"data/icons/ArchiMate/BusinessProcess.png",
"data" : [
{
"lang":"nl",
"name":"Dossieroverdracht",
"type":"Bedrijfsproces",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">Het zorgkantoor ontvangt vanuit de Basisregistratie Personen (BRP) melding van de verhuizing van de client. Het zorgkantoor draagt de client op basis van dit signaal over aan het nieuwe zorgkantoor. De overdrachtdatum is de eerste dag waarop het nieuwe zorgkantoor verantwoordelijk is voor de client. De overdrachtdatum mag afwijken van de verhuisdatum zoals die in de BRP is geregistreerd&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\"></span>"}}]
}
]
}
