"type":"Requirement",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">Correcties op een melding aanvang zorg zijn uitsluitend toegestaan voor de geleverde zorgeenheid. Als de zorg beeindigd is, kan de aanvang niet meer op deze manier gecorrigeerd worden.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Met de status aanlevering van een berichtklasse kan worden aangegeven of&nbsp;<p style=\"margin-top: 3pt;\">* een berichtklasse nieuw is (waarde 1);&nbsp;<p style=\"margin-top: 3pt;\">* een berichtklasse gewijzigd is (waarde 2);&nbsp;<p style=\"margin-top: 3pt;\">* een berichtklasse verwijderd moet worden (waarde 3). Een verwijdering betekent dat de vorige aanlevering met dezelfde sleutel als niet verzonden beschouwd moet worden.&nbsp;<p style=\"margin-top: 3pt;\"></span>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"CA317","id":27946,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"AW39","id":27986,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"CA319","id":29113,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"AW35","id":30565,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Bedrijfsregel":{"code":"OP033","geen technische regels":false}}}]
