"lang":"nl",
"name":"OP341: Wanneer sprake is van deeltijdverblijf moet het geleverde aantal etmalen verblijf overeenkomen met het toegewezen aantal etmalen.",
"type":"Requirement",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 11pt;\">Indien het aantal etmalen dat de client verblijft niet (meer) overeenkomt met het toegewezen aantal etmalen, moet de dossierhouder hiervoor aangepaste zorgtoewijzingen aanvragen voor alle zorgaanbieders die betrokken zijn bij de levering van deeltijdverblijf aan de client.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\"></span><span style=\" font-size: 11pt; font-family: Arial;\"></span><span style=\" font-size: 10pt; font-family: Arial;\">&nbsp;<p style=\"margin-top: 3pt;\"></span>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"AW35","id":30565,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"ZK35","id":30585,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Bedrijfsregel":{"code":"OP341","geen technische regels":false}}}]
