"type":"Requirement",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">Bijvoorbeeld als er sprake is van doorlopende zorg wordt een nieuwe toewijzing op een nieuwe indicatie gestuurd voor de reeds geleverde zorg. Hierdoor wijzigt er niets in de zorglevering, maar wordt toch een nieuw bericht van de zorgaanbieder verwacht.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Een nieuwe zorgtoewijzing is een zorgtoewijzing met een logische sleutel die nog niet eerder is ontvangen.&nbsp;<p style=\"margin-top: 3pt;\"></span>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"AW39","id":27986,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"AW35","id":30565,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Bedrijfsregel":{"code":"OP0661"}}}]
