"28620" : {
"id":28620,
"typeIconPath":"data/icons/ArchiMate/MotivationUseCase.png",
"data" : [
{
"lang":"nl",
"name":"IV030: Hoe wordt Meerzorg gevuld?",
"type":"Usecase",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">Het element Meerzorg maakt onderdeel uit van Indicatie in het IO31-bericht en kan technisch gezien de waarde '1' (Ja) of de waarde '2' (Nee) bevatten of afwezig zijn COD260 - JA OF NEE). De waarde '2' wordt (vooralsnog) niet gebruikt. Het CIZ vult het element met de waarde '1' (Ja) of laat het element weg. &nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Betekenis:&nbsp;<p style=\"margin-top: 3pt;\">Het CIZ neemt het element Meerzorg op in het indicatiebesluitbericht en vult het met de waarde '1' (Ja) als bij indicatiestelling, conform de geldende CIZ-beleidsregels, is vastgesteld dat de client recht heeft op meerzorg. In alle andere gevallen wordt het element niet meegestuurd. De ontvangst van een indicatiebesluitbericht waarin Meerzorg de waarde '1' (Ja) heeft is, voor het zorgkantoor het signaal om voor de betreffende client de meerzorgprocedure te starten. Ook als het element niet is meegestuurd kan het zorgkantoor op verzoek van de client de meerzorgprocedure starten.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\"></span>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"IO31","id":29310,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"ZK31","id":29659,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Invulinstructie":{"code":"IV030"}}}]
}
]
}
