"28730" : {
"id":28730,
"typeIconPath":"data/icons/ArchiMate/MotivationUseCase.png",
"data" : [
{
"lang":"nl",
"name":"IV100: Hoe moet de classificatie bij de leveringsstatus worden gevuld?",
"type":"Usecase",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 9pt;\">Aan de leveringsstatussen Urgent plaatsen, Actief plaatsen, Wacht op voorkeur en Wacht uit voorzorg is een classificatie toegevoegd. De classificatie dient om de situatie van de cli&#235;nt te verduidelijken en meer inzicht te geven in de wachtlijsten. Met deze informatie kan gerichter gezocht worden naar passende zorg voor de cli&#235;nt en kan het zorgkantoor de zorgaanbieder beter ondersteunen in het wachtlijstbeheer. &nbsp;<p style=\"margin-top: 3pt;\"> &nbsp;<p style=\"margin-top: 3pt;\">De zorgaanbieder geeft met de classificatie aan waarom of waarop de cli&#235;nt wacht. De classificatie is de primaire reden voor de betreffende leveringsstatus. &nbsp;<p style=\"margin-top: 3pt;\">Er kunnen meer achterliggende oorzaken zijn, maar er kan slechts &#233;&#233;n classificatie per leveringsstatus worden gekozen en aangeleverd aan het zorgkantoor. &nbsp;<p style=\"margin-top: 3pt;\"> &nbsp;<p style=\"margin-top: 3pt;\">Voor het vullen van de leveringsstatussen geldt het volgende:&nbsp;<p style=\"margin-top: 3pt;\"> &nbsp;<p style=\"margin-top: 3pt;\">Urgent plaatsen: &nbsp;<p style=\"margin-top: 3pt;\">Deze leveringsstatus is van toepassing als opname voor de cli&#235;nt op (zeer) korte termijn noodzakelijk &nbsp;is (Opnamenoodzaak)&nbsp;<p style=\"margin-top: 3pt;\"> &nbsp;<p style=\"margin-top: 3pt;\">Actief plaatsen: &nbsp;<p style=\"margin-top: 3pt;\">Deze leveringsstatus is van toepassing als opname voor de cli&#235;nt binnen een of enkele maanden noodzakelijk is (Opnamebehoefte)&nbsp;<p style=\"margin-top: 3pt;\"> &nbsp;<p style=\"margin-top: 3pt;\">Wacht op voorkeur: &nbsp;<p style=\"margin-top: 3pt;\">Deze leveringsstatus is van toepassing als de cli&#235;nt opgenomen wil worden, maar pas als aan een aantal randvoorwaarden wordt voldaan (Opnamewens)&nbsp;<p style=\"margin-top: 3pt;\"> &nbsp;<p style=\"margin-top: 3pt;\">Wacht uit voorzorg: &nbsp;<p style=\"margin-top: 3pt;\">Deze leveringsstatus is van toepassing als de cli&#235;nt zich in de thuissituatie prima kan redden maar wel op een wachtlijst bij een voorkeuraanbieder wil staan (Geen opnamewens) &nbsp;<p style=\"margin-top: 3pt;\"> &nbsp;<p style=\"margin-top: 3pt;\">De volgende combinaties van leveringsstatus en classificaties zijn mogelijk:&nbsp;<p style=\"margin-top: 3pt;\"> &nbsp;<p style=\"margin-top: 3pt;\">6 - Urgent plaatsen&nbsp;<p style=\"margin-top: 3pt;\">01&nbsp;&nbsp;&nbsp;&nbsp;Geen passend crisisbed beschikbaar&nbsp;<p style=\"margin-top: 3pt;\">02&nbsp;&nbsp;&nbsp;&nbsp;Doorstroom crisisbed&nbsp;<p style=\"margin-top: 3pt;\">03&nbsp;&nbsp;&nbsp;&nbsp;Doorstroom ziekenhuis (ZH)&nbsp;<p style=\"margin-top: 3pt;\">04&nbsp;&nbsp;&nbsp;&nbsp;Doorstroom eerstelijnsverblijf (ELV)&nbsp;<p style=\"margin-top: 3pt;\">05&nbsp;&nbsp;&nbsp;&nbsp;Doorstroom geriatrische revalidatiezorg (GRZ)&nbsp;<p style=\"margin-top: 3pt;\">06&nbsp;&nbsp;&nbsp;&nbsp;Palliatief terminale zorg (PTZ)&nbsp;<p style=\"margin-top: 3pt;\">07&nbsp;&nbsp;&nbsp;&nbsp;Art 28a (WZD)&nbsp;<p style=\"margin-top: 3pt;\">08&nbsp;&nbsp;&nbsp;&nbsp;Rechterlijke machtiging (RM)&nbsp;<p style=\"margin-top: 3pt;\"> &nbsp;<p style=\"margin-top: 3pt;\">7 - Actief plaatsen&nbsp;<p style=\"margin-top: 3pt;\">09&nbsp;&nbsp;&nbsp;&nbsp;Dreigende crisis (thuis)&nbsp;<p style=\"margin-top: 3pt;\">10&nbsp;&nbsp;&nbsp;&nbsp;Niet passende zorg&nbsp;<p style=\"margin-top: 3pt;\">11&nbsp;&nbsp;&nbsp;&nbsp;(Tijdelijk) andere aanbieder bespreekbaar&nbsp;<p style=\"margin-top: 3pt;\">12&nbsp;&nbsp;&nbsp;&nbsp;Voorkeuraanbieder leidend&nbsp;<p style=\"margin-top: 3pt;\"> &nbsp;<p style=\"margin-top: 3pt;\">2 - Wacht op voorkeur&nbsp;<p style=\"margin-top: 3pt;\">13&nbsp;&nbsp;&nbsp;&nbsp;Specifieke locatie/woonwens&nbsp;<p style=\"margin-top: 3pt;\">14&nbsp;&nbsp;&nbsp;&nbsp;Specifieke locatie/gespecialiseerde zorg&nbsp;<p style=\"margin-top: 3pt;\">15&nbsp;&nbsp;&nbsp;&nbsp;Partneropname&nbsp;<p style=\"margin-top: 3pt;\">16&nbsp;&nbsp;&nbsp;&nbsp;Logeren&nbsp;<p style=\"margin-top: 3pt;\">17&nbsp;&nbsp;&nbsp;&nbsp;Specifieke geografische redenen&nbsp;<p style=\"margin-top: 3pt;\">18&nbsp;&nbsp;&nbsp;&nbsp;Doorstroom naar geclusterd wonen VPT&nbsp;<p style=\"margin-top: 3pt;\">19&nbsp;&nbsp;&nbsp;&nbsp;Geen aanvullende wens(en)&nbsp;<p style=\"margin-top: 3pt;\"> &nbsp;<p style=\"margin-top: 3pt;\">3 - Wacht uit voorzorg&nbsp;<p style=\"margin-top: 3pt;\">13&nbsp;&nbsp;&nbsp;&nbsp;Specifieke locatie/woonwens&nbsp;<p style=\"margin-top: 3pt;\">14&nbsp;&nbsp;&nbsp;&nbsp;Specifieke locatie/gespecialiseerde zorg&nbsp;<p style=\"margin-top: 3pt;\">15&nbsp;&nbsp;&nbsp;&nbsp;Partneropname&nbsp;<p style=\"margin-top: 3pt;\">17&nbsp;&nbsp;&nbsp;&nbsp;Specifieke geografische redenen&nbsp;<p style=\"margin-top: 3pt;\">18&nbsp;&nbsp;&nbsp;&nbsp;Doorstroom naar geclusterd wonen VPT&nbsp;<p style=\"margin-top: 3pt;\">19&nbsp;&nbsp;&nbsp;&nbsp;Geen aanvullende wens(en)&nbsp;<p style=\"margin-top: 3pt;\"> &nbsp;<p style=\"margin-top: 3pt;\">4 - In zorg: geen classificaties&nbsp;<p style=\"margin-top: 3pt;\">5 - Einde zorgvraag: geen classificaties&nbsp;<p style=\"margin-top: 3pt;\"> &nbsp;<p style=\"margin-top: 3pt;\">Als aan een leveringsstatus een classificatie gekoppeld is, moet deze verplicht gevuld worden. De naam/omschrijving van de classificaties geeft aan voor welke situaties de verschillende classificaties bedoeld zijn. Hoe dit in de praktijk gehanteerd moet worden is gedetailleerd beschreven in het Voorschrift Zorgtoewijzing (onderdeel van de documenten van Zorginkoop door zorgkantoren). Zowel op iStandaarden.nl als in het Voorschrift Zorgtoewijzing wordt het gebruik van de leveringsstatussen en classificaties aan de hand van voorbeeldsituaties verduidelijkt. &nbsp;<p style=\"margin-top: 3pt;\"> &nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Wijzigingen van leveringsstatus en/of classificatie:&nbsp;<p style=\"margin-top: 3pt;\">Wijzigingen in de situatie van een client die leiden tot een andere leveringsstatus en/of classificatie worden zo spoedig mogelijk door de zorgaanbieder via het berichtenverkeer (MUT) doorgegeven. Het handmatig doorvoeren van aanpassingen is ongewenst omdat hierdoor een verschil in wachtlijstinformatie/classificatie tussen zorgkantoor en zorgaanbieder kan ontstaan.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\"></span>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"AW39","id":27986,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"ZK31","id":29659,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"ZK39","id":30559,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"AW317","id":30562,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Invulinstructie":{"code":"IV100"}}}]
}
]
}
