"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">Het element GeheimeClient wordt door het CIZ gevuld met ja indien de client bij het CIZ geregistreerd staat met de status geheim persoon. Deze status heeft betrekking op Blijf van mijn lijfhuizen of indicaties waarbij uit veiligheidsoverwegingen de privacy van de client gewaarborgd moet worden. &nbsp;<p style=\"margin-top: 3pt;\">Overdracht van deze clientgegevens aan derden moet uiterst zorgvuldig gebeuren om te voorkomen dat de clienten traceerbaar zijn, wat grote gevolgen kan hebben voor de veiligheid van deze clienten.&nbsp;<p style=\"margin-top: 3pt;\"></span>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"IO31","id":29310,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"ZK31","id":29659,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"AW33","id":30150,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"ZK33","id":30568,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Invulinstructie":{"code":"IV026"}}}]
