"lang":"nl",
"name":"TR073: De Mutatiecode moet toegestaan zijn bij de Soort uit de toegewezen zorgeenheid.",
"type":"Beperking",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">De toegestane combinaties Mutatiecode -- Soort toewijzing:&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">* 12 (Cli</span><span style=\" font-size: 10pt; font-family: Arial;\">e</span><span style=\" font-size: 10pt;\">nt wil de zorg (nu) nog niet) -- 1 (Regulier) &nbsp;<p style=\"margin-top: 3pt;\">* 17 (Overplaatsing (er is een MAZ)) -- &lt;geen beperking&gt;&nbsp;<p style=\"margin-top: 3pt;\">* 18 (Aanbieder kan de zorg nu nog niet leveren) -- 1 (Regulier) &nbsp;<p style=\"margin-top: 3pt;\">* 19 (Levering zorg is be</span><span style=\" font-size: 10pt; font-family: Arial;\">e</span><span style=\" font-size: 10pt;\">indigd - zorgtoewijzing sluiten) -- &lt;geen beperking&gt;&nbsp;<p style=\"margin-top: 3pt;\">* 20 (Levering zorg is be</span><span style=\" font-size: 10pt; font-family: Arial;\">e</span><span style=\" font-size: 10pt;\">indigd - zorgtoewijzing aanhouden) -- &lt;geen beperking&gt;&nbsp;<p style=\"margin-top: 3pt;\">* 21 (Overdracht ZTW (er is geen MAZ)) -- 1 (Regulier)</span><span style=\" font-size: 10pt;\"></span><span style=\" font-size: 10pt; font-family: Arial;\">&nbsp;<p style=\"margin-top: 3pt;\"></span>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"AW39","id":27986,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"LDT_RetourCode-Wlz","id":30317,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"ZK39","id":30559,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Technische regel":{"code":"TR073","niveau":"berichtoverstijgend"}}}]
