"28874" : {
"id":28874,
"typeIconPath":"data/icons/ArchiMate/MotivationUseCase.png",
"data" : [
{
"lang":"nl",
"name":"IV019: Welke Begindatum zorglevering moet worden gevuld in het wachtlijstbericht?",
"type":"Usecase",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">In het wachtlijstrecord moet als Begindatum de begindatum uit een melding aanvang zorg worden overgenomen die het dichtst bij de Ingangsdatum van de betreffende zorgeenheid ligt. &nbsp;<p style=\"margin-top: 3pt;\">Bij leveringsvorm PGB wordt de Begindatum overgenomen uit de interne Wlz administratie van het zorgkantoor. &nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Voor zorgtoewijzingen die na het beeindigen van de zorg worden aangehouden en waar later opnieuw zorg op wordt geleverd, geldt dat alleen van de eerste keer dat geleverd is de Begindatum wordt opgenomen.&nbsp;<p style=\"margin-top: 3pt;\"></span>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"AW317","id":30562,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Invulinstructie":{"code":"IV019"}}}]
}
]
}
,
