"28932" : {
"id":28932,
"typeIconPath":"data/icons/ArchiMate/MotivationRequirement.png",
"data" : [
{
"lang":"nl",
"name":"OP033x1: Een afgegeven zorgtoewijzing mag gewijzigd worden waarbij de wijziging met een nieuw bericht moet worden doorgegeven.",
"type":"Requirement",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">De volgende wijzigingen zijn toegestaan: &nbsp;<p style=\"margin-top: 3pt;\">* aanpassen van de gewenste einddatum zorgtoewijzing zodat de periode korter wordt (= intrekken);&nbsp;<p style=\"margin-top: 3pt;\">* aanpassen van de gewenste einddatum zorgtoewijzing zodat de periode langer wordt (=oprekken) (NB dit is alleen toegestaan in overleg met de zorgaanbieder);&nbsp;<p style=\"margin-top: 3pt;\">* verhogen van de omvang van de zorgtoewijzing (klasse en/of opslag);&nbsp;<p style=\"margin-top: 3pt;\">* aanpassen van de soort toewijzing;&nbsp;<p style=\"margin-top: 3pt;\">* aanpassen van het toewijzingpercentage;&nbsp;<p style=\"margin-top: 3pt;\">* aanpassen van Opname van J naar N en omgekeerd (NB dit is alleen toegestaan in overleg met de zorgaanbieder).&nbsp;<p style=\"margin-top: 3pt;\">* aanpassen van het aantal etmalen (NB dit is alleen toegestaan in overleg met de zorgaanbieder)&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Overige elementen die geen onderdeel uitmaken van de sleutel kunnen ook gewijzigd worden, maar zijn op zichzelf geen aanleiding voor het versturen van een gewijzigde toewijzing.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">De meest recente zorgtoewijzing op toewijzingsdatum en -tijd is bepalend voor de inhoud van de zorgtoewijzing.&nbsp;<p style=\"margin-top: 3pt;\"></span>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"AW33","id":30150,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"ZK33","id":30568,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Bedrijfsregel":{"code":"OP033x1"}}}]
}
]
}
,
"28949" : {
"id":28949,
"typeIconPath":"data/icons/ArchiMate/MotivationUseCase.png",
"data" : [
{
"lang":"nl",
"name":"IV029: Hoe moet VoorkeurClient gevuld worden?",
"type":"Usecase",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">VoorkeurClient is een gecodeerde aanduiding van de voorkeur van de client ten aanzien van plaats en/of vorm van zorglevering. Dit element is opgenomen in de geindiceerde zorgeenheid (alleen zorgzwaartepakket). &nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">VoorkeurClient wordt gevuld met een waarde uit codelijst COD999 - VOORKEUR CLIENT. &nbsp;<p style=\"margin-top: 3pt;\"><b>&nbsp;<p style=\"margin-top: 3pt;\">GeindiceerdZorgzwaartepakket</b>&nbsp;<p style=\"margin-top: 3pt;\">VoorkeurClient in de indicatie geeft aan wat de voorkeur van de client is op het moment van indicatiestelling. Er zijn geen technische regels voor het vullen van VoorkeurClient, ook niet voor de combinatie met InstellingVoorkeur; het gaat hier om de wens van de client. &nbsp;<p style=\"margin-top: 3pt;\">Het CIZ zal overigens voor ZZP0 (partnerverblijf) altijd 4 (Verblijf) vullen. &nbsp;<p style=\"margin-top: 3pt;\">Hoe moet VoorkeurClient gevuld worden?&nbsp;<p style=\"margin-top: 3pt;\">Het volgende is daarbij van belang:&nbsp;<p style=\"margin-top: 3pt;\"> &nbsp;&nbsp;a. Wil de client de zorg in een instelling ontvangen -&gt; dan 4 (Verblijf) vullen en als de client daarbij de dagbesteding met een PGB wil inkopen, dan 9 (Verblijf/PGB) vullen.&nbsp;<p style=\"margin-top: 3pt;\"> &nbsp;&nbsp;b. Wil de client de zorg thuis ontvangen? -&gt; dan zijn er de volgende mogelijkheden:&nbsp;<p style=\"margin-top: 3pt;\"> &nbsp;&nbsp;&nbsp;* Als de client de zorg volledig met een PGB wil inkopen, dan 2 (PGB) vullen.&nbsp;<p style=\"margin-top: 3pt;\"> &nbsp;&nbsp;&nbsp;* Als de client (nog) niet weet in welke vorm hij de zorg thuis wil ontvangen, dan 3 (Zorg thuis (niet nader gespecificeerd)) vullen.&nbsp;<p style=\"margin-top: 3pt;\"> &nbsp;&nbsp;&nbsp;* Als de client de zorg in de vorm van een VPT wil ontvangen, dan 5 (VPT) vullen en als de client daarbij de dagbesteding met een PGB wil inkopen, dan 8 (VPT/PGB vullen.&nbsp;<p style=\"margin-top: 3pt;\"> &nbsp;&nbsp;&nbsp;* Als de client de zorg in de vorm van een MPT wil ontvangen, dan 7 (MPT) vullen.&nbsp;<p style=\"margin-top: 3pt;\"> &nbsp;&nbsp;&nbsp;* Als de client de zorg gedeeltelijk met een PGB wil inkopen en de rest in natura wil ontvangen, dan 6 (Combinatie PGB/MPT) vullen.&nbsp;<p style=\"margin-top: 3pt;\"> &nbsp;&nbsp;c. Als de client de zorg in de vorm van deeltijdverblijf (DTV) wil ontvangen, dan 10 (DTV) vullen.&nbsp;<p style=\"margin-top: 3pt;\"> &nbsp;&nbsp;d. Als de voorkeur van de client volledig onbekend is, dan VoorkeurClient leeg laten. &nbsp;&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\"></span>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"IO31","id":29310,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"ZK31","id":29659,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"AW33","id":30150,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"ZK33","id":30568,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Invulinstructie":{"code":"IV029"}}}]
}
]
}
