"type":"Beperking",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 9pt;\">Een inzending met status aanlevering '2' (Gewijzigde aanlevering) kan alleen indien eerder voor dezelfde Client een bericht met Status aanlevering '1' (Eerste aanlevering) is ingezonden met dezelfde sleutel.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">De meest recente aanlevering, met status aanlevering '2' (Gewijzigde aanlevering), vervangt de eerder verzonden aanlevering met status aanlevering '1' of '2'. Het is daarom noodzakelijk om bij gebruik van status aanlevering 2 het retourbericht af te wachten voordat een eventueel volgende correctie met status 2 of 3 wordt ingestuurd.</span><span style=\" font-size: 9pt;\"></span><span style=\" font-size: 9pt; font-family: Arial;\"></span><span style=\" font-size: 10pt; font-family: Arial;\">&nbsp;<p style=\"margin-top: 3pt;\"></span>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"CA317","id":27946,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"CA319","id":29113,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"LDT_RetourCode-Wlz","id":30317,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Technische regel":{"code":"TR103","niveau":"berichtoverstijgend"}}}]
