"29381" : {
"id":29381,
"typeIconPath":"data/icons/ArchiMate/MotivationUseCase.png",
"data" : [
{
"lang":"nl",
"name":"IV101: Hoe moet mutatiecode worden gevuld?",
"type":"Usecase",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 9pt;\">Bij het vullen van de mutatiecode is het allereerst van belang of de cli&#235;nt wel of niet in zorg is voor de zorgtoewijzing waarop de mutatie van toepassing is.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\"><b>Als op de betreffende zorgtoewijzing eerder een MAZ gestuurd is en de cli&#235;nt is niet tussentijds uit zorg gemeld, dan zijn er de volgende mogelijkheden:&nbsp;<p style=\"margin-top: 3pt;\"></b>&nbsp;<p style=\"margin-top: 3pt;\">17 - Overplaatsing (er is een melding aanvang zorg): &nbsp;<p style=\"margin-top: 3pt;\">Deze code is van toepassing in de situatie dat de zorglevering aan een client ongewijzigd, op basis van dezelfde zorgtoewijzing, bij een andere zorgaanbieder wordt voortgezet en bij de huidige aanbieder volledig stopt. &nbsp;<p style=\"margin-top: 3pt;\">Voorwaarde voor het gebruik van deze code is dat bekend is welke zorgaanbieder de zorglevering overneemt. &nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">19 - Levering zorg is be&#235;indigd (zorgtoewijzing sluiten): &nbsp;<p style=\"margin-top: 3pt;\">Deze code is van toepassing als de zorglevering aan een cli&#235;nt op basis van de huidige zorgtoewijzing in zijn geheel stopt en er geen sprake is van overplaatsing. Deze mutatiecode kan gecombineerd worden met een aanvraag aangepaste zorgtoewijzing (AAT) om andere zorg (bijvoorbeeld zorg thuis in plaats van verblijf) en/of zorglevering door een andere aanbieder aan te vragen. &nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">20 - Levering zorg is be&#235;indigd (zorgtoewijzing aanhouden):&nbsp;<p style=\"margin-top: 3pt;\">Deze code is van toepassing als de zorglevering aan een cli&#235;nt op basis van de huidige zorgtoewijzing in zijn geheel tijdelijk stopt en er geen sprake is van overplaatsing. Verwacht wordt dat de zorglevering op basis van dezelfde zorgtoewijzing na enige tijd wordt hervat. De zorgtoewijzing wordt om die reden aangehouden.&nbsp;<p style=\"margin-top: 3pt;\">N.B. Als enige tijd na het versturen van een bericht met mutatiecode 20 duidelijk wordt dat de zorglevering niet meer hervat zal worden, stuurt de aanbieder een bericht met mutatiecode 12 en leveringsstatus Einde zorg. &nbsp;<p style=\"margin-top: 3pt;\"><span style=\" font-family: Times New Roman;\">&nbsp;<p style=\"margin-top: 3pt;\"><b>Als op de betreffende zorgtoewijzing niet eerder een MAZ gestuurd is of er is wel een MAZ gestuurd en de cli&#235;nt is daarna (tijdelijk) uit zorg gemeld, dan zijn er de volgende mogelijkheden:&nbsp;<p style=\"margin-top: 3pt;\"></b><span style=\" font-family: Times New Roman;\">&nbsp;<p style=\"margin-top: 3pt;\">12 - Client wil nu de zorg (nog) niet:&nbsp;<p style=\"margin-top: 3pt;\">Deze code is van toepassing als een client de toegewezen zorg niet of nog niet wil ontvangen of als de client de toegewezen zorg niet van deze aanbieder wil ontvangen. &nbsp;<p style=\"margin-top: 3pt;\">Mutatiecode 12 kan gecombineerd worden met een aanvraag aangepaste zorgtoewijzing (AAT) om, wel of niet tijdelijk, andere zorg (bijvoorbeeld zorg thuis in plaats van verblijf) en/of zorglevering door een andere aanbieder aan te vragen. &nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">18 - Aanbieder kan nu de zorg nog niet leveren:&nbsp;<p style=\"margin-top: 3pt;\">Deze code is van toepassing als de zorgaanbieder nu nog geen plaats heeft voor de cli&#235;nt en de cli&#235;nt wil wachten op levering van de toegewezen zorg bij deze (voorkeur)aanbieder. Mutatiecode 18 kan gecombineerd worden met een aanvraag aangepaste zorgtoewijzing (AAT) om voor de wachtperiode andere zorg (bijvoorbeeld zorg thuis in plaats van verblijf) en/of zorglevering door een andere aanbieder aan te vragen.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">21 - Overdracht zorgtoewijzing (er is geen melding aanvang zorg):&nbsp;<p style=\"margin-top: 3pt;\">Deze code is van toepassing in de situatie dat een zorgaanbieder een zorgtoewijzing heeft ontvangen die voor een andere zorgaanbieder (AGB-code) bedoeld is. Al voor aanvang zorg is duidelijk dat de cli&#235;nt de toegewezen zorg van een andere aanbieder wil ontvangen. Dat kan bijvoorbeeld een andere AGB-code van dezelfde zorginstelling betreffen. &nbsp;<p style=\"margin-top: 3pt;\">Voorwaarde voor het gebruik van deze code is dat bekend is aan welke zorgaanbieder de zorgtoewijzing overgedragen moet worden.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Schematisch: &nbsp;<p style=\"margin-top: 3pt;\">A: Mutatiecode / B: Client in zorg? / C: Versturen MUT voor ingangsdatum ZTW mogelijk? / &nbsp;D: Uitsluitend voor reguliere ZTW? / E: Einde zorg? / F: Combinatie AAT mogelijk? / G: Leveringsstatus&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\"><ul style=\"margin-top: 0pt; margin-bottom: 0pt;\"><li>A: 17 | B: Ja &nbsp;| C: Nee | D: Nee | &nbsp;E: Ja &nbsp;| F: Nee | G: Einde zorgvraag</li><li>A: 19 | B: Ja &nbsp;| C: Nee | D: Nee | &nbsp;E: Ja &nbsp;| F: Ja &nbsp;| G: Einde zorgvraag</li><li>A: 20 | B: Ja &nbsp;| C: Nee | D: Nee | &nbsp;E: Nee | F: Nee | G: Urgent plaatsen, Actief plaatsen, Wacht op voorkeur, Wacht op voorzorg</ul>&nbsp;<p style=\"margin-top: 3pt;\"></li><ul style=\"margin-top: 0pt; margin-bottom: 0pt;\"><li>A: 12 | B: Nee | C: Ja | D: Ja | &nbsp;E: Nee/Ja | F: Ja &nbsp;| G: Wacht uit voorzorg, Einde zorgvraag</li><li>A: 18 | B: Nee | C: Ja | D: Ja | &nbsp;E: Nee | F: Ja &nbsp;| G: &nbsp;Urgent plaatsen, Actief plaatsen, Wacht op voorkeur</li><li>A: 21 | B: Nee | C: Ja | D: Ja | &nbsp;E: Ja &nbsp;| F: Nee | G: Einde zorgvraag</ul>&nbsp;<p style=\"margin-top: 3pt;\"><span style=\" font-family: Arial;\"></span><span style=\" font-size: 10pt; font-family: Arial;\">&nbsp;<p style=\"margin-top: 3pt;\"></span></li>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"AW39","id":27986,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"ZK39","id":30559,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Invulinstructie":{"code":"IV101"}}}]
}
]
}
