"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">Aanduiding of de client heeft aangegeven dat hij de geindiceerde zorg (nog) niet wil ontvangen.&nbsp;<p style=\"margin-top: 3pt;\"></span>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"type":{"type":"object","value":{"name":"LDT_JaNee","id":29092,"typeIconPath":"data/icons/UML/UML_DataType.png"}}}}}]
