,
"29409" : {
"id":29409,
"typeIconPath":"data/icons/ArchiMate/MotivationUseCase.png",
"data" : [
{
"lang":"nl",
"name":"IV031: Hoe wordt ZietAfVanZorg gevuld?",
"type":"Usecase",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">Indien de client op de peildatum afziet van het ontvangen van zorg in welke vorm dan ook moet het veld ZietAfVanZorg gevuld worden met 'ja'(1). In de overige gevallen moet het veld ZietAfVanZorg gevuld worden met 'nee'(2). Deze informatie volgt niet direct uit het berichtenverkeer, maar kan wel door het zorgkantoor uit het berichtenverkeer worden herleid. &nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Hiervoor zijn verschillende situaties denkbaar. &nbsp;<p style=\"margin-top: 3pt;\">1. Uitstroom naar een ander zorgdomein (Wlz-indiceerbaren) &nbsp;<p style=\"margin-top: 3pt;\">2. Andere reden voor afzien van zorg &nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Toelichting bij 1:&nbsp;<p style=\"margin-top: 3pt;\">Vanwege het overgangsrecht Wlz-indiceerbaren blijft een afgegeven indicatie voor een zorgeenheid geldig voor terugkeer naar de Wlz wanneer een client is uitgestroomd naar een ander zorgdomein. Omdat deze client een geldig indicatiebesluit heeft, moet deze worden aangeleverd in het wachtlijstbestand. De client zal zonder extra informatie als 'actief wachtend' worden gekenmerkt omdat er binnen het wachtlijstbestand voor die zorgeenheid geen bijpassend wachtlijstrecord aanwezig is. Door het element ZietAfVanZorg in een dergelijk geval te vullen met 'ja' zal de client niet meer aangemerkt worden als actief wachtend, maar als slaapwachtend. &nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Toelichting bij 2:&nbsp;<p style=\"margin-top: 3pt;\">Het kan ook zijn dat de client heeft aangegeven nog geen gebruik of geen gebruik meer te willen maken van de aan hem of haar geindiceerde zorg. Dit kan volgen uit contact met die client vanuit het zorgkantoor of op aangeven van de zorgaanbieder. Omdat de zorglevering in dit geval niet gestart zal worden of in het tweede geval omdat de zorglevering juist stopt op aangeven van de client, zal de client zonder extra informatie als 'actief wachtend' worden gekenmerkt. Door het element ZietAfVanZorg te vullen met 'ja' zal deze client voor deze zorgeenheid als 'slaap wachtend' worden gekenmerkt. Het Wachtlijstproces van het Zorgkantoor is uiteindelijk bepalend op grond waarvan besloten kan worden dat de client af ziet van zorg. &nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Nota bene: Een client die net een indicatie heeft gekregen waarbij er nog geen voorkeur bekend is, ziet niet af van zorg, maar is actief wachtend.&nbsp;<p style=\"margin-top: 3pt;\"></span>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"AW317","id":30562,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Invulinstructie":{"code":"IV031"}}}]
}
]
}
