"29017" : {
"id":29017,
"typeIconPath":"data/icons/ArchiMate/MotivationUseCase.png",
"data" : [
{
"lang":"nl",
"name":"IV021: Hoe moet Leveringsvorm worden gevuld in het wachtlijstbericht?",
"type":"Usecase",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">In het wachtlijstbericht wordt in Leveringsvorm aangegeven in welke vorm de client de zorgeenheid ontvangt. De leveringsvorm wordt overgenomen uit de toewijzing, tenzij de client de zorgeenheid ontvangt in de vorm van een PGB. In dat geval wordt hier de waarde 2 (Persoonsgebonden budget (PGB)) gevuld. Bij Leveringsvorm PGB is de client altijd in zorg, het is daarom niet nodig om voor een PGB de Leveringsstatus (Leveringsstatus en IngangsdatumStatus) in het bericht op te nemen. &nbsp;<p style=\"margin-top: 3pt;\">Indien sprake is van een verkeerde-bed-situatie, wacht de cli&#235;nt met een Wlz-indicatie in het ziekenhuis op opname in een instelling of zorg thuis. Voor de verkeerde-bed-situatie is geen zorgtoewijzing aanwezig. Leveringsvorm mag daarom niet de waarde 9 (Verkeerde bed (VKB)) bevatten&nbsp;<p style=\"margin-top: 3pt;\"></span>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"AW317","id":30562,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Invulinstructie":{"code":"IV021"}}}]
}
]
}
