"39844" : {
"id":39844,
"typeIconPath":"data/icons/ArchiMate/ViewGraphic.png",
"data" : [
{
"lang":"nl",
"name":"De keten van processen in de Wlz start op het moment dat een client een aanvraag doet voor een indicatie. Het  CIZ voert de beoordeling uit en stelt, indien de client recht heeft op Wlz zorg, een indicatiebesluit op. Dit besluit  wordt verzonden aan het zorgkantoor dat verantwoordelijk is voor de client.  Het zorgkantoor bekijkt in overleg met de client waar en in welke vorm hij de zorg wil ontvangen. Vervolgens wijst het zorgkantoor de zorg toe aan de zorgaanbieder.  De zorgaanbieder geeft in overleg met de client verdere invulling aan de toewijzing. De zorgaanbieder meldt aan het zorgkantoor wanneer de levering gestart is, of wanneer het niet direct mogelijk is om de zorg te leveren. Wanneer  de zorg beeindigd wordt, wordt dit ook weer aan het zorgkantoor doorgegeven.  De processen in het Informatiemodel zijn afgeleid uit de waardeketen voor zorg en ondersteuning, zoals die  hieronder is weergegeven.",
"type":"Tekenvorm",
"categories":[]
}
]
}
